import React from 'react';
import './App.css';
import { motion, useCycle } from 'framer-motion';
import Test1 from './test1';
import Test2 from './test2';





function App() {
  const styles = {
    navContainer: {
      position: 'fixed',
      top: 0,
      left: 0,
      width: '200px',
      height: '100vh',
      backgroundColor: '#0ff',
      zIndex: '1',
      display: 'flex',
      flexDirection: 'column',
      justifyContent: 'center',
      alignItems: 'center',
    },
    navToggle: {
      // position: 'absolute',
      top: '20px',
      left: '20px',
      zIndex: 1,
      backgroundColor: '#0ff5a9',
      width: '50px',
      height: '50px',
      borderRadius: '50%',
    },
  }

  return (
    <>
      <div style={styles.navToggle} />

      {/* <div id='testingContainer'>
        <Test1 />
        <Test2 />
      </div> */}
    </>
  );
}



export default App;
